create proc incQty(@id int)
as
begin
	update Cart 
	set Prod_Quantity +=1
	where Cart_Id=@id
end
------------------------
create proc decQty(@id int)
as
begin
	update Cart 
	set Prod_Quantity -=1
	where Cart_Id=@id
end
------------------------
create proc CalTotal(@id int)
as
begin
	select sum(Prod_Quantity*Prod_Price) from Cart where User_Id = @id
end
